import React, { Component } from "react";

import { Container, Row, Col, Image } from "react-bootstrap";

class Item extends Component {
  render() {
    const { titre, image, description, url } = this.props;
    return (
      <div>
        <Container align="right">
          <Row>
            <Col xs={6} md={4}>
              <h4> {titre}</h4>
            </Col>
            <h4> {description}</h4>
            <col xs={6} md={4}>
              <Image width="100px" src={image} alt="image" />
            </col>
            <video src={url} alt="url" />
          </Row>
        </Container>
      </div>
    );
  }
}

export default Item;
